import React, { useState } from 'react';
import './App.css';
import Header from './components/Header';
import FeedbackData from './data/FeedbackData';
import FeedbackLists from './components/FeedbackLists';
import Practice from './components/Practice';

function App() {

const [feedback,setFeedback] = useState(FeedbackData)


class FirstComponent extends React.Component{
  render(){
    return(
      <div>
        <h2>First Components</h2>
      </div>
    )
  }
}

class SecondComponents extends React.Component{
  render(){
    return(
      <>
      <h3>Second Components</h3>
      </>
    )
  }
}

class ThirdComponents extends React.Component{
  render(){
    return(
      <>
      <h4>Third Components</h4>
      </>
    )
  }
}

function FourthComponents (name){
  return(
    <div>
      <h5>{name} Component</h5>
    </div>
  )
}

  return (
    <>
      <Header />
      <FeedbackLists feed={feedback}/>
      <Practice />
      <FirstComponent />
      <SecondComponents />
      <ThirdComponents />
      <FourthComponents name='Fourth' />
    </>
  );
}

export default App;
